import React from "react";

function TableCom({ value }) {
  if (value) {
    value.map((value, index) => {
      return (
        <tr key={index}>
          <td>{value.id}</td>
          <td>{value.name}</td>
          <td>{value.email}</td>
          <td>{value.address.street}</td>
          <td>{value.phone}</td>
        </tr>
      );
    });
  } else {
    return <td>Click the button</td>;
  }
}

export default TableCom;
